var c_freq_osc_0 = 0;
const freq_osc_0 = 0;
configFreqSweep(freq_osc_0,24104600.0,200000.0);
waitDigTrigger(1);
playZero(160);
resetOscPhase();
repeat (1024) {
  c_freq_osc_0 = 0;
  playZero(176);
  setSweepStep(freq_osc_0,c_freq_osc_0++);
  playZero(4000);
  startQA(0,1,0,0,2);
  setTrigger(0);
  repeat (200) {
    playZero(176);
    setSweepStep(freq_osc_0,c_freq_osc_0++);
    playZero(4000);
    startQA(0,1,0,0,2);
    setTrigger(0);
  }
}

waitDigTrigger(1);
playZero(160);
resetOscPhase();
executeTableEntry(0);
repeat (1024) {
  repeat (201) {
    playZero(4176);
  }
}
